        this.load.image(MapKeys.f1_ObjConfigTileset[6].key, MapKeys.f1_ObjConfigTileset[6].url, { frameWidth: 16 })
        this.load.image(MapKeys.f1_ObjConfigTileset[7].key, MapKeys.f1_ObjConfigTileset[7].url, { frameWidth: 16 })
